events.script:
#uses &quot;SUECN_comments.ctl&quot;

string kust = $KUST;
string sNumber = $Number;
string sys = kust + &quot;:&quot;;
// string sys = &quot;8:&quot;;
// string kust = &quot;8&quot;;
// string sNumber = 2;
string dp = sys + kust + &quot;=SUECN_&quot; + sNumber;

dyn_anytype cConf, dConf;
dyn_string gConf, rConf;

void addComments(){
  dyn_string dps;
  for(int i=1; i&lt;=dynlen(suecn_dp); i++){
    dpSetComment(sys + kust + &quot;=SUECN_&quot; + sNumber + suecn_dp[i], &quot;Куст: &quot; + kust + &quot;. Скважина: &quot; + txt_geolog.text +&quot;. &quot; + suecn_comments[i]);
    dpSetUnit(sys + kust + &quot;=SUECN_&quot; + sNumber + suecn_dp[i], suecn_unit[i]);
  }
}

void stsDriver(dyn_string dps, dyn_anytype val){
  rec_driver.backCol = val[1] ? &quot;green&quot;:&quot;red&quot;;
  rec_dsts.backCol = (val[2] == 1) ? &quot;green&quot;:&quot;red&quot;;
}
void saveToDp(){
  dyn_anytype cSave, dSave;
  dyn_string  rSave;

  cSave[1] = chk_enable.state(0);
  cSave[2] = txt_geolog.text;
  cSave[3] = cmb_ecn.selectedPos - 1;
  cSave[4] = cmb_skv.selectedPos - 1;

  rSave[1] = txt_p_before.text;
  rSave[2] = txt_p_after.text;
  rSave[3] = txt_t_before.text;
  rSave[4] = txt_t_after.text;
  rSave[5] = txt_zd1.text;
  rSave[6] = txt_zd2.text;

  dSave[1] = txt_driver.text;
  dSave[2] = txt_host.text;
  dSave[3] = cbx_code.selectedPos;

  dpSetWait(dp + &quot;.Settings.Enable&quot;          , cSave[1],
            dp + &quot;.Settings.Number_Geolog&quot;   , cSave[2],
            dp + &quot;.Settings.Type&quot;            , cSave[3],
            dp + &quot;.Settings.Type_SKV&quot;        , cSave[4]);

  dpSetWait(dp + &quot;.ForReference.PT_Before_ZD&quot;, rSave[1],
            dp + &quot;.ForReference.PT_After_ZD&quot; , rSave[2],
            dp + &quot;.ForReference.TT_Before_ZD&quot;, rSave[3],
            dp + &quot;.ForReference.TT_After_ZD&quot; , rSave[4],
            dp + &quot;.ForReference.ZD1&quot;         , rSave[5],
            dp + &quot;.ForReference.ZD2&quot;         , rSave[6]);

  dpSetWait(sys + &quot;_Mod_Plc_&quot; + cSave[2] + &quot;.UnitAddress&quot;   , dSave[1],
            sys + &quot;_Mod_Plc_&quot; + cSave[2] + &quot;.HostsAndPorts&quot; , makeDynString(dSave[2]),
            sys + &quot;_Mod_Plc_&quot; + cSave[2] + &quot;.Coding&quot;        , dSave[3]);
}

void getDrvParams(string num){
  dyn_string prepHosts;
  dpGet(sys + &quot;_Mod_Plc_&quot; + num + &quot;.UnitAddress&quot;, dConf[1],
        sys + &quot;_Mod_Plc_&quot; + num + &quot;.HostsAndPorts&quot;, prepHosts,
        sys + &quot;_Mod_Plc_&quot; + num + &quot;.Coding&quot;, dConf[3]);
  if(dynlen(prepHosts))
    dConf[2] = prepHosts[1];
  else
    dConf[2] = &quot;&quot;;


  txt_driver.text(dConf[1]);
  txt_host.text(dConf[2]);
  cbx_code.selectedPos(dConf[3]);
}

main(){
  dpGet(dp + &quot;.Settings.Enable&quot;          , cConf[1],
        dp + &quot;.Settings.Number_Geolog&quot;   , cConf[2],
        dp + &quot;.Settings.Type&quot;            , cConf[3],
        dp + &quot;.Settings.Type_SKV&quot;        , cConf[4],

        dp + &quot;.Settings.NomerGZU&quot;        , gConf[1],
        dp + &quot;.Settings.Number_otvod&quot;    , gConf[2],

        dp + &quot;.ForReference.PT_Before_ZD&quot;, rConf[1],
        dp + &quot;.ForReference.PT_After_ZD&quot; , rConf[2],
        dp + &quot;.ForReference.TT_Before_ZD&quot;, rConf[3],
        dp + &quot;.ForReference.TT_After_ZD&quot; , rConf[4],
        dp + &quot;.ForReference.ZD1&quot;         , rConf[5],
        dp + &quot;.ForReference.ZD2&quot;         , rConf[6]);

  if(dpExists(sys + &quot;_Mod_Plc_&quot; + cConf[2] + &quot;.&quot;)){// 8:_Mod_Plc_8035.Active
    rec_create.visible(false);
    getDrvParams(cConf[2]);
    dpConnect(&quot;stsDriver&quot;, sys + &quot;_Mod_Plc_&quot; + cConf[2] + &quot;.Active&quot;,
                           sys + &quot;_Mod_Plc_&quot; + cConf[2] + &quot;.ConnState&quot;);
  }else{
    rec_create.visible(true);
  }

  chk_enable.state(0, cConf[1]);
  txt_geolog.text(cConf[2]);
  cmb_ecn.selectedPos(cConf[3] + 1);
  cmb_skv.selectedPos(cConf[4] + 1);

  txt_top.text(&quot;ГЗУ:&quot;+gConf[1]+&quot; Отвод:&quot;+gConf[2]);
  txt_bot.text(&quot;SUECN_&quot;+sNumber);

  txt_p_before.text(rConf[1]);
  txt_p_after.text (rConf[2]);
  txt_t_before.text(rConf[3]);
  txt_t_after.text (rConf[4]);
  txt_zd1.text     (rConf[5]);
  txt_zd2.text     (rConf[6]);
}

main(mapping event){
  int err;
  dpCopy(sys + &quot;_Mod_Plc_1&quot;, sys + &quot;_Mod_Plc_&quot; + txt_geolog.text, err);
  if(err != 0){
    dyn_errClass ec = getLastError();
    throwError(ec);  
    return;
  }    
  dpCopyOriginal(sys + &quot;_Mod_Plc_1&quot;, sys + &quot;_Mod_Plc_&quot; + txt_geolog.text, err);
  if(err != 0){
    dyn_errClass ec = getLastError();
    throwError(ec);  
    return;
  }    
}

main(mapping event)
{
  dyn_string txt=makeDynString(&quot;PUSH_BUTTON, Сохранить, 1, 1&quot;,
                               &quot;PUSH_BUTTON, Добавить комментарии, 2, 1&quot;);
  int answer;
  popupMenu(txt, answer);
  switch(answer){
    case 1: 
      saveToDp();
      break;
     case 2:
      addComments();
    default: 
      DebugN(&quot;ERROR: COMAND NOT FOUND.&quot;);  
  }
}
